import './styles/footer.css';
function Footer() {
    return (
        <div className="footer">
            <hr />
            <footer className="content">
                <div>
                    <span>2024 company inc</span>
                </div>
                <div>
                    <span>Moses Kyazze</span>
                </div>
            </footer>
        </div>
    );
}

export default Footer;
